import React from "react";

class Home extends React.Component {
  render(): React.ReactNode {
    return (
      <div>
        {(() => {
          const options = [];

          for (let i = 1; i <= 6; i++) {
            options.push(
              <div
                style={{
                  width: "100%",
                  height: "10em",
                  background: "#ddd",
                  marginBottom: ".5em",
                }}
              ></div>
            );
          }

          return options;
        })()}
      </div>
    );
  }
}
export default Home;
